package test.data;

public class GradeProcess {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int score = 90;
		if (score > 90)
			System.out.println("A");
		if (score > 80)
			System.out.println("B");
		if (score > 70)
			System.out.println("C");
		if (score > 60)
			System.out.println("D");
		else
			System.out.println("F");
	}

}
